    <div className="font color-body">
      <Container className="p-5">
        <Row className="justify-content-center">
          <Col sm="4">
            <div className="fs-3 text-center  py-2">اسئلة واجوبة شائعة</div>
          </Col>

          <Col sm="8">
            <FormInput />
            <QA />
            <button></button>
          </Col>

        </Row>
      </Container>
    </div>
  );
}

export default App;
